import React from 'react';
import "./register.css";
import LoginRegister from '../LoginRegister/LoginRegister';


const Register = () => {
  const linkUrl = '/login';
  return (
    <LoginRegister title='Hello!' heading='Create Your Account' btntext='SIGN UP' googlebtn='Sign Up With Google' githubbtn='Sign Up With Github' account="Don't have an Account?" loginsignup='SIGN UP' link={linkUrl} isSignIn={true}/>
  )
}

export default Register
